import difflib

def get_diff_sections(str1, str2):
    diff = list(difflib.unified_diff(str1.splitlines(), str2.splitlines(), lineterm=""))

    section = []
    for line in diff:
        if line.startswith("@@"):
            # Print the previous section before starting a new one
            if section:
                print(" ".join(section))  # Join lines in the section into a single line
            section = [line]  # Start a new section
        else:
            section.append(line.strip())  # Remove excess whitespace/newlines

    # Print the last collected section
    if section:
        print(" ".join(section))
